class Solution:
	def suggestedProducts(self, products, searchWord: str):
		products.sort()
		ans=[]
		for i in range(len(searchWord)):
			char=searchWord[:i+1]
			l=[]
			for p in products:
				if p.startswith(char):
					l.append(p)
			ans.append(l[:3])
		# print(ans)
		return ans

